import React from 'react';
import { Container } from 'react-bootstrap';

const Home = () => {
    return (
        <Container className="text-center mt-5">
            <h1>Welcome to My Profile!</h1>
            <p className="mt-3">
                I am a software engineer with a passion for web development. My career goal is to become a full-stack developer.
            </p>
        </Container>
    );
};

export default Home;
